import React from 'react';
import ItemTramo from './ItemTramo';
import styles from './ListaRecursos.module.css'

const LISTA_HORAS = [
      {
        id: "h1",
        hora: "8:00 A.M.",
      },
      {
        id: "h2",
        hora: "8:30 A.M.",
      },
      {
        id: "h3",
        hora: "9:00 A.M.",
      },
      {
        id: "h4",
        hora: "9:30 A.M.",
      },
      {
        id: "h5",
        hora: "10:00 A.M.",
      },
      {
        id: "h6",
        hora: "10:30 A.M.",
      },
      {
        id: "h7",
        hora: "11:00 A.M.",
      },
      {
        id: "h8",
        hora: "11:30 A.M.",
      },
      {
        id: "h9",
        hora: "12:00 P.M.",
      },
      {
        id: "h10",
        hora: "12:30 P.M.",
      },
      {
        id: "h11",
        hora: "1:00 P.M.",
      },
      {
        id: "h12",
        hora: "1:30 P.M.",
      },
      {
        id: "h13",
        hora: "2:00 P.M.",
      },
      {
        id: "h14",
        hora: "2:30 P.M.",
      },
      {
        id: "h15",
        hora: "3:00 P.M.",
      },
      {
        id: "h16",
        hora: "3:30 P.M.",
      },
      {
        id: "h17",
        hora: "4:00 P.M.",
      },
      {
        id: "h18",
        hora: "4:30 P.M.",
      },
      {
        id: "h19",
        hora: "5:00 P.M.",
      },
      {
        id: "h20",
        hora: "5:30 P.M.",
      },
      {
        id: "h21",
        hora: "6:00 P.M.",
      },
      {
        id: "h22",
        hora: "6:30 P.M.",
      },
      {
        id: "h23",
        hora: "7:00 P.M.",
      },
      {
        id: "h24",
        hora: "7:30 P.M.",
      },
      {
        id: "h24",
        hora: "8:00 P.M.",
      }
    ];



const ListaRecursos = (props) => {

    const listaHoras = LISTA_HORAS.map((hora)=> <ItemTramo key={hora.id} title={hora.hora}/>);
    
    return <section className={styles.lista}>{listaHoras}</section>
};

export default ListaRecursos;
